오늘도 지구는 불타는 중. 어쩌면 아픈 건지도 모르겠다, 내가 감기 걸리면 열 나는 것처럼. 난 감기 이제 완전히 헤어짐, 정말! 오는 길에 사고 날 뻔한 아이를 구함. 새로 사귄 친구랑 수다를 떨음. 그 집 아이스 초코가 맛있더라, 이상!

